import React from "react";
const Card = (props) => <>
    <div className="cards">         
    {<img
        src={props.imgsrc}
        alt="Marvel Hero"
    />}
    <p>props.movieName</p>
    <button>
        <a href={props.link} rel="noreferrer" target="_blank">Watch Now</a></button>
    </div> 
        
</>;

export default Card;
